__NUXT_JSONP__("/directores/director_3", (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:[{director:{slug:a,id:a,name:"Chad Stahelski",nationality:"Canadian",birth_year:1941,programs:["Compilers","Data Structures"],image:"directores\u002Fdirector_3.jpg",toc:[],body:{type:b,children:[{type:c,tag:d,props:{},children:[{type:e,value:"Chad Stahelski es un director de cine y doble de riesgo estadounidense, reconocido por dirigir la trilogía de John Wick.​​​ Stahelski además ofició como doble de Brandon Lee tras el accidente que le costó la vida al actor durante el rodaje de la película The Crow."}]}]},dir:"\u002Fdirectores",path:"\u002Fdirectores\u002Fdirector_3",extension:f,createdAt:g,updatedAt:"2021-10-11T03:24:47.515Z"},peliculas:[{slug:h,id:h,title:"Naruto, The Last",year:i,duration:"1h 54min",language:j,pages:1040,directorId:a,productoraId:"productora_3",image:"peliculas\u002Fpelicula_5.jpg",toc:[],body:{type:b,children:[{type:c,tag:d,props:{},children:[{type:e,value:"Han pasado dos años desde que la Cuarta Guerra Ninja llegara a su fin y el mundo parece estar en armonía de nuevo. Desgraciadamente, dicha paz se va al traste en el momento en que una nueva amenaza se cierne sobre el planeta. En medio de esta catástrofe, Hanabi Hyūga, hermana de Hinata, es secuestrada. Naruto y un equipo de ninjas formado por la propia Hinata, Sakura, Sai y Shikamaru parten en busca de la pequeña que está en manos del malvado Toneri Ōtsutsuki. Durante el viaje se van enfrentando a todo tipo de pruebas y enemigos que ponen a prueba el destino del mundo ninja y la relación que tienen entre ellos (en especial Hinata y Naruto). Mientras la cuenta atrás se acerca peligrosamente a su final, nuestros ninjas se pone manos a la obra para luchar por la paz... y el amor."}]}]},dir:k,path:"\u002Fpeliculas\u002Fpelicula_5",extension:f,createdAt:g,updatedAt:"2021-10-11T03:01:32.724Z"},{slug:l,id:l,title:"Anabelle",year:i,duration:"1h 39min",language:j,pages:448,directorId:a,productoraId:"productora_2",image:"peliculas\u002Fpelicula_6.jpg",toc:[],body:{type:b,children:[{type:c,tag:d,props:{},children:[{type:e,value:"ohn Form encuentra el regalo perfecto para Mia, su mujer embarazada: una preciosa muñeca 'vintage' llamada Annabelle. Una noche, una secta satánica les ataca brutalmente. Además, provocan que un ente maligno se apodere de Annabelle."}]}]},dir:k,path:"\u002Fpeliculas\u002Fpelicula_6",extension:f,createdAt:g,updatedAt:"2021-10-11T03:02:27.024Z"}]}],fetch:{},mutations:void 0}}("director_3","root","element","p","text",".md","2021-10-11T02:16:58.966Z","pelicula_5",2014,"ENGLISH","\u002Fpeliculas","pelicula_6")));